import { userContex, userContex2 } from './App';

export default function ComponentC() {
  return (
    <div>
        <userContex.Consumer>
            {
                user =>{
                    return (
                        <userContex2.Consumer>
                            {
                                user2 =>{
                                    return (
                                        <div>UserContex value {user}, {user2}</div>
                                    )
                                }
                            }
                        </userContex2.Consumer>
                    )
                }
            }
        </userContex.Consumer>
    </div>
  )
}
